select * from student_Records

---inserting values to the  student_Records Table

SELECT * FROM Student_Records;

--selecting columns Student_Name, Contact_Number, Admission_Year by filtering  Course_of_Study = Environmental Science
select Student_Name, Contact_Number, Admission_Year
from Student_Records
where Course_of_Study = 'Environmental Science';

--selecting columns Student_Name, Contact_Number, Admission_Year filtered by Course_of_Study = Environmental Science and Admission_Year= 2019
select Student_Name, Contact_Number, Admission_Year
from Student_Records
where Course_of_Study = 'Environmental Science' and Admission_Year= 2019;

---creation of a stored procedure known as Environmental_Science_2019 to get columns Student_Name, Contact_Number, Admission_Year filtered by Course_of_Study = Environmental Science and Admission_Year= 2019
CREATE PROCEDURE Environmental_Science_2019
AS
select Student_Name, Contact_Number, Admission_Year
from Student_Records
where Course_of_Study = 'Environmental Science' and Admission_Year= 2019
GO

---the Execution of the stored procedure - Environmental_Science_2019
EXEC Environmental_Science_2019

SELECT * FROM Books

CREATE PROCEDURE Books_Table
AS
SELECT * FROM Books
GO;

EXEC Books_Table

select * from Books
where Year_Published between 2010 AND 2020
ORDER BY Year_Published DESC;

select Category, COUNT(Category) AS [Number of Occurences]
into germany 
from Books
where Year_Published between 2010 AND 2020
GROUP BY Category
ORDER BY [Number of Occurences] DESC;

EXEC sp_rename 'germany', '[Filtered Books]';
 
EXEC Books_Table

SELECT * FROM Books
WHERE Year_Published IN (1957, 2010)
Order by Book_Title DESC;

SELECT (select CONVERT(FLOAT, Rental_Price) AS [Price Integer])AS Rent_Value
FROM Books;

select Category, (select CONVERT(FLOAT, Rental_Price) AS [Price Integer])AS Rent_Value from Books;

ALTER TABLE Borrowers_Record
ADD CONSTRAINT FK_Borrowers_Record_Student_Records FOREIGN KEY(Student_ID) REFERENCES Student_Records(Student_ID);


select b.Student_ID 
from Student_Records a
LEFT join Borrowers_Record b
on a.Student_ID = b.Student_ID;

